import React, { useState, useMemo, useEffect } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import About from "./pages/About";
import "./styles/App.css";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/about">
            <About></About>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
